import React from "react";
import Button from "../UI/Button";
import Loading from "../UI/Loading";
import Card from "../UI/Card";
import TableRow from "./TableRow";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCheck, faDash} from  '@fortawesome/free-solid-svg-icons';

const Plans = () => {

    const check = <FontAwesomeIcon icon={faCheck} />;
    const dash = <FontAwesomeIcon icon={faDash} />;

  return (
    <Card>
      <table>
        <tr>
          <th>Plans</th>
          <th>Free</th>
          <th>Monthly</th>
          <th>Yearly</th>
          <th>Lifetime</th>
        </tr>
      </table>
      <TableRow title={'CNFT Data'} free={check} monthly={check} yearly={check} life={check}/>
      <TableRow
        title={"Crypto Data"}
        free={check}
      />
      <TableRow title={"Borrow Assistance"} />
      <TableRow title={"Lend Assistance"} />
      <TableRow title={"Crypto Trade"} />
      <TableRow title={"NFT Trade"} />
    </Card>
  );
};

export default Plans;
